import matplotlib.pyplot as plt
import pandas as pd
import numpy as np
from wordcloud import WordCloud
from PIL import Image
from stop_words import get_stop_words
import base64

#load data
cliwok15 = pd.read_csv('../input/CLIWOC15.csv')

cs_ES = ""
cs_NL = ""
cs_UK = ""
cs_FR = ""
# Only one text, not  really representative
cs_SW = ""

textos = cliwok15[pd.notnull(cliwok15.OtherRem)][['InstLand','OtherRem']].drop_duplicates()
textos = textos.reset_index()

for i in range(len(textos.OtherRem)):
    if textos.InstLand[i] == 'Spain':
        cs_ES += " " + str(textos.OtherRem[i])
    elif textos.InstLand[i] == 'United Kingdom':
        cs_UK += " " + str(textos.OtherRem[i])
    elif textos.InstLand[i] == 'France':
        cs_FR += " " + str(textos.OtherRem[i])
    elif textos.InstLand[i] == 'Nederland':
        cs_NL += " " + str(textos.OtherRem[i])
    elif textos.InstLand[i] == 'Sweden':
        cs_SW += " " + str(textos.OtherRem[i])

STOPWORDS_ES = get_stop_words('spanish')
STOPWORDS_NL = get_stop_words('dutch')
STOPWORDS_FR = get_stop_words('french')
STOPWORDS_UK = get_stop_words('english')
STOPWORDS_SW = get_stop_words('swedish')

#Generate map images:
imagen_ES = ''
imagen_NL = ''
imagen_FR = ''
imagen_UK = ''
imagen_SW = ''

fh = open("mapa-espana.png", "wb")
fh.write(base64.b64decode(imagen_ES))
fh.close()

fh = open("mapa-nederland.png", "wb")
fh.write(base64.b64decode(imagen_NL))
fh.close()

fh = open("mapa-france.png", "wb")
fh.write(base64.b64decode(imagen_FR))
fh.close()

fh = open("mapa-uk.png", "wb")
fh.write(base64.b64decode(imagen_UK))
fh.close()

fh = open("mapa-sw.png", "wb")
fh.write(base64.b64decode(imagen_SW))
fh.close()


#ESPAA
es_mask = np.array(Image.open("mapa-espana.png"))

wc_ES = WordCloud(background_color="white"
                  , max_words=1000
                  , mask=es_mask
                  , stopwords=STOPWORDS_ES)
wc_ES.generate(cs_ES)
wc_ES.to_file("wc_ES.png")
plt.figure(figsize=(13,8))
plt.imshow(wc_ES)
plt.axis("off")

#Nederland
nl_mask = np.array(Image.open("mapa-nederland.png"))
wc_NL = WordCloud(background_color="white"
                  , max_words=2000
                  , mask=nl_mask
                  , stopwords=STOPWORDS_NL)

wc_NL.generate(cs_NL)
wc_NL.to_file("wc_NL.png")
plt.figure(figsize=(13,8) )
plt.imshow(wc_NL)
plt.axis("off")
plt.figure()

#FRANCE
fr_mask = np.array(Image.open("mapa-france.png"))

wc_FR = WordCloud(background_color="white"
                  , max_words=2000
                  , mask=fr_mask
                  , stopwords=STOPWORDS_FR)
wc_FR.generate(cs_FR)
wc_FR.to_file("wc_FR.png")
plt.figure(figsize=(13,8) )
plt.imshow(wc_FR)
plt.axis("off")

#UK
uk_mask = np.array(Image.open("mapa-uk.png"))

wc_UK = WordCloud(background_color="white"
                  , max_words=2000
                  , mask=uk_mask
                  , stopwords=STOPWORDS_UK)
wc_UK.generate(cs_UK)
wc_UK.to_file("wc_UK.png")
plt.figure(figsize=(15,10) )
plt.imshow(wc_UK)
plt.axis("off")
plt.figure()

#Sweden --> is written in English
sw_mask = np.array(Image.open("mapa-sw.png"))

wc_SW = WordCloud(background_color="white"
                  , max_words=2000
                  , mask=sw_mask
                  , stopwords=STOPWORDS_SW)
wc_SW.generate(cs_SW)
wc_SW.to_file("wc_SW.png")
plt.figure(figsize=(13,8) )
plt.imshow(wc_SW)
plt.axis("off")
plt.figure()

